import React, { Component } from 'react'
import GoogleMapReact from 'google-map-react';
import GoogleMapMarkers from 'google-map-react';

import google from 'https://maps.googleapis.com/maps/api/js'

const apiKey = "AIzaSyB8uwCpGazZQ4JvdwNQP9Jt0GH0FukWd-M";


class MapField extends Component {

  constructor(props) {
    super(props);
    this.state = "";
  }

  initMap = () => {
    let mMap = new google.maps.Map(document.getElementById('map'), {
      center: {
        lat: 50.121870,
        lng: 8.689550
      },
      zoom: 13
    });
  };

  render() {
    return (
      <div>{this.initMap()}</div>
    )
  }
}

export default MapField
